import React from "react";

function Masakan() {
  return (
    <div className="row m-4">
      <div className="p-5 mb-4 rounded-3">
        <div className="container-fluid text-center">
          <h1 className="display-5 fw-bold mb-5">Masakan</h1>
          <p className="col-lg-12 fs-4" style={{ textAlign: "center" }}>
            Makanan khas Jawa Barat mempunyai karakteristiknya sendiri misalnya
            untuk makanan lauk biasanya memiliki rasa yang cederung asam dan
            pedas, menggunakan sayur mentah sebagai pendamping atau lalapan,
            banyak masakan yang menggunakan ikan.
          </p>
        </div>
      </div>
    </div>
  );
}

export default Masakan;
